package diameter.ro_r10_transatel;

import com.intellinet.diameter.*;


/**
 * IMS-Charging-Identifier AVP is of type UTF8String and holds the IMS Charging Identifier
 * as generated by a IMS node for a SIP session.
 */
public class IMSChargingIdentifier extends com.intellinet.diameter.DerivedAVP<String> {
    /**
     * Constructs a IMSChargingIdentifier with the given value.
     *
     * @param value - the value of the AVP
     */
    public IMSChargingIdentifier(String value) {
        super(new com.intellinet.diameter.UTF8StringData(value));
    }

    IMSChargingIdentifier(com.intellinet.diameter.UTF8StringData data) {
        super(data);
    }
}
